import React from "react";

const BOOLEAN = { true: "true", false: "false" };
const PAGES = { homepage: "homepage", notebook: "notebook" };

function NewItemPopup({ setCurrentScreen }) {
  return (
    <div class="new-item-popup">
      <div
        className="popup-row"
        onClick={() => setCurrentScreen(PAGES.notebook)}
      >
        <p>Notebook</p>
      </div>
      <div
        className="popup-row"
        onClick={() => setCurrentScreen(PAGES.notebook)}
      >
        <p>Dataset</p>
      </div>
      <div
        className="popup-row"
        onClick={() => setCurrentScreen(PAGES.notebook)}
      >
        <p>Chart</p>
      </div>
    </div>
  );
}

export default NewItemPopup;
